import React from 'react';

function About() {
    return (
        <section className="container-fluid">
            <div className="row justify-content-center">
                <h2 className="col">About Me</h2>    
            </div>

            <div className="row">
                <img className="col-4 rounded-circle" src={require('../../assets/images/headshot.jpg')} alt='Headshot'/>
                <p className="col-8">
                    Example bio paragraph about me
                </p>    
            </div>

        </section>
    )
}

export default About;
